DROP PROCEDURE IF EXISTS `UpdateEmergencia`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `UpdateEmergencia` (IN `fecha` DATE, IN `inicio` TIME, IN `fin` TIME, IN `direccion` VARCHAR(100), IN `precio` FLOAT, IN `honorarios` FLOAT, IN `paciente` VARCHAR(100), IN `edad` INT, IN `estudios` TEXT, IN `comentarios` TEXT, IN `IDEmergencia` INT, IN `Estado` INT, IN `IDUsuario` INT, IN `horas` FLOAT, IN `rol` INT)   BEGIN
START TRANSACTION;

	#consultamos el valor de la hora extra actual
    SET @Hora_Extra = (SELECT d.precio FROM datos d WHERE d.rol = rol);

SET @Hora_Extra = ROUND(@Hora_Extra * horas, 2);

	#modificamos la emergencia
	UPDATE emergencia e SET 
		e.inicio = inicio, 
		e.fin = fin, 
		e.direccion = direccion, 
		e.precio = precio,
		e.honorarios = honorarios,
		e.hora_extra = @Hora_Extra,
		e.paciente = paciente,
		e.edad = edad,
		e.estudios = estudios,
		e.f_estado = estado
	WHERE e.id = IDEmergencia;


	#Verificamos que comentarios no sea NULL
	IF comentarios IS NOT NULL THEN
		SET @Comentarios = (SELECT count(c.id) FROM comentario c
		WHERE c.f_emergencia = IDEmergencia
		ORDER BY c.id ASC
		LIMIT 1);
	
		IF @Comentarios > 0 THEN
			#modificamos el primer comentario
			UPDATE comentario c SET c.comentario = comentarios
			WHERE c.f_emergencia = IDEmergencia
			ORDER BY c.id ASC
			LIMIT 1;
		ELSE
	    	VALUES(CONCAT(fecha, ' ', inicio), comentarios, 'Inicio Emergencia', IDUsuario, IDEmergencia);
		END IF;
	END IF;
	    
COMMIT;
END$$

DROP PROCEDURE IF EXISTS `UpdateEmergencia_Admin`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `UpdateEmergencia_Admin` (IN `inicio` TIME, IN `fin` TIME, IN `direccion` VARCHAR(100), IN `precio` FLOAT, IN `honorarios` FLOAT, IN `paciente` VARCHAR(100), IN `edad` INT, IN `estudios` TEXT, IN `IDEmergencia` INT, IN `Estado` INT, IN `horas` FLOAT)   BEGIN
START TRANSACTION;

	#verificamos el estado actual de la emergencia
    SET @EstadoActual = (SELECT e.f_estado FROM emergencia e WHERE e.id = IDEmergencia); 


   	IF @EstadoActual = 2 THEN #Solo se pueden hacer modificaciones cuando el estado es = 2 osea (Ingresasa)
   
   		#Consultamos el rol del usuario propietario de la emergencia
   		SET @Rol = (SELECT r.id FROM emergencia e JOIN usuarios u ON u.id = e.f_usuario
   		JOIN rol r ON r.id = u.F_rol WHERE e.id = IDEmergencia);
   	
   		#consultamos el valor de la hora extra actual
	    SET @Hora_Extra = (SELECT d.precio FROM datos d WHERE d.rol = @Rol); 
	   
	    SET @Hora_Extra = ROUND(@Hora_Extra * horas, 2);
   	
		IF Estado IS NOT NULL THEN
			#modificamos la emergencia
			UPDATE emergencia e SET 
				e.inicio = inicio, 
				e.fin = fin, 
				e.direccion = direccion, 
				e.precio = precio,
				e.honorarios = honorarios,
				e.hora_extra = @Hora_Extra,
				e.paciente = paciente,
				e.edad = edad,
				e.estudios = estudios,
				e.f_estado = estado
			WHERE e.id = IDEmergencia;
		ELSE
			#modificamos la emergencia
			UPDATE emergencia e SET 
				e.inicio = inicio, 
				e.fin = fin, 
				e.direccion = direccion, 
				e.precio = precio,
				e.honorarios = honorarios,
				e.hora_extra = @Hora_Extra,
				e.paciente = paciente,
				e.edad = edad,
				e.estudios = estudios
			WHERE e.id = IDEmergencia;
		END IF;
	
	ELSE 
		#cuando el admin esté pasando al estado Aprobado
		IF @EstadoActual = 3 THEN
		
			IF Estado IS NOT NULL THEN
				#modificamos el estado de la emergencia
				UPDATE emergencia e SET 
					e.f_estado = estado
				WHERE e.id = IDEmergencia;
			END IF;
		
		END IF;
	
	END IF;
	    
COMMIT;
END$$

DROP PROCEDURE IF EXISTS `UpdatePass`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `UpdatePass` (IN `Codigo` VARCHAR(5), IN `Pass` VARCHAR(200), IN `Correo` VARCHAR(70))  NO SQL BEGIN
START TRANSACTION;

	#Se actualiza la contraseña
	UPDATE usuarios u SET u.pass = Pass WHERE u.correo = Correo;

	#Actualizamos el estado de codigo_update_pass
	UPDATE codigo_update_pass c SET c.confirmado = 1 WHERE c.codigo = Codigo;
    
COMMIT;
END$$

